import "../styles/group.css"
export default function Group(){
    return(
      <div className="group_name">
          <div className="title">
            <span className="heading">Computer Engineering</span>
            <span className="followers">142,765 Computer Engineers follow this</span>
          </div>
       </div>
    )
}
